import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import MainDash from "./components/MainDash/MainDash";
import RightSide from "./components/RightSide/RightSide"; // ตรวจสอบชื่อไฟล์ให้ถูกต้อง
import Sidebar from "./components/Sidebar";
import TableData from "./page/TableData"; // ตรวจสอบ path ว่าถูกต้อง

function App() {
  return (
    <Router>
      <div className="App">
        <div className="AppGlass">
          <Sidebar />
          <Routes>
            <Route path="/" element={<MainDash />} />
            <Route path="/tabledata" element={<TableData />} />
            {/* เพิ่มเส้นทางอื่นๆ ที่ต้องการที่นี่ */}
          </Routes>
          <RightSide />
        </div>
      </div>
    </Router>
  );
}

export default App;
